import './App.css';
import Header from './components/Header';
// import Footer from './components/Footer';
// import React, {useState} from 'react'
import { BrowserRouter, Routes, Route} from 'react-router-dom';
import {useState,React} from 'react'


function App() {
  const [isDarkMode, setIsDarkMode] = useState(false);

  const toggleDarkMode = () => {
    setIsDarkMode(!isDarkMode);
  };
  return (
    <>
    <div className={isDarkMode ? 'body-d' : 'body-l'} id='appjs'>
     <BrowserRouter>
      <Header/>
      <Routes>
        <Route path="/" Component={Home}/>
        <Route path="/contact" Component={Contact}/>
        <Route path="/about" Component={About}/>
        <Route path="/services" Component={Services}/>
        <Route path="/login" Component={Login}/>
        <Route path="/signUp" Component={SignUp}/>
        <Route path="/team" Component={Team}/>
        <Route path="/photos" Component={Photos}/>
        <Route path="/travelling" Component={Travelling}/>
        <Route path="/rentalCars" Component={RentalCars}/>
        <Route path="/departure" Component={Departure}/>
        <Route path="/tourNorth" Component={TourNORTH}/>
        <Route path="/tourSouth" Component={TourSOUTH}/>
        <Route path="/tourEast" Component={TourEAST}/>
        <Route path="/tourWest" Component={TourWEST}/>
        <Route path="/rentalCar_Booking" Component={RentalCar_Booking}/>
        <Route path="/GetQuote" Component={GetQuote}/>
      </Routes>
    </BrowserRouter>
    <button onClick={toggleDarkMode}>
        {isDarkMode ? 'dark' : 'light'}
      </button>
    </div>
    </>
  );
};

export default App;
